Brief voor de Koning, De (2008)  

Nederland
Avontuur
107 minuten

geregisseerd door Pieter Verhoeff
met Yannick van de Velde, Quinten Schram en Daan Schuurmans

De 16-jarige schildknaap Tiuri zet zijn toekomst op het spel wanneer een stervende ridder hem de opdracht geeft een mysterieuze brief voor de koning van Unauwen te bezorgen. Zijn avontuurlijke tocht leidt hem door bossen, bergen en dalen waar het gevaar altijd op de loer ligt. Lukt het hem heelhuids Unauwen te bereiken en de brief aan de koning te overhandigen?

